import classes from "./Modal.module.css";
import React from "react";

const modal = (props) => {
  return (
    <div className={classes.ModalContainer}>
      <div className={classes.ModalContent}>
        <h2>{props.title}</h2>
        <p>{props.message}</p>
      </div>
    </div>
  );
};

export default modal;
